    var inputLength = trimmedInput.length;
    var mapping = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=";
    var lastIndex = mapping.charAt(64);

    if (lastIndex) {
        var indexOfLast = trimmedInput.indexOf(lastIndex);
        if (indexOfLast !== -1) {
            inputLength = indexOfLast;
        }
    }

    var resultArray = [];
    var outputIndex = 0;
